import Navbar from "./Navbar";
import Head from "next/head";

const Layout = (props) => (
  <div>
    <Head>
      <title>Coinview</title>
      <link rel="stylesheet" href="../bootstrap.min.css" />
    </Head>
    <Navbar />
    {props.children}
  </div>
);
export default Layout;
